job.description:
Hello! We are looking for a talented .NET Developer with a strong background in .NET development and a passion for creating innovative solutions.

Responsibilities:

- Collaborate with the development team to design and implement .NET-based web applications;
- Develop and maintain backend services and APIs using .NET technologies;
- Write clean, efficient, and maintainable code following best practices;
- Participate in code reviews and provide constructive feedback to team members;
- Stay updated on the latest .NET trends and technologies; 

Requirements:

- Proven experience as a .NET Developer with a strong portfolio;
- Proficiency in C#, ASP.NET, and related technologies;
- Experience with front-end technologies such as HTML, CSS, and JavaScript;
- Experience with Microsoft Azure or other cloud platforms;
- Knowledge of modern web development frameworks like Angular or React;
- Familiarity with agile development methodologies;

In your proposal share your relevant experience and portfolio. Thanks

